const CORSAIR_COMMAND_WRITE       = 0x07;

const CORSAIR_LIGHTING_CONTROL_HARDWARE           = 0x01;
const CORSAIR_LIGHTING_CONTROL_SOFTWARE           = 0x02;

const CORSAIR_PROPERTY_SPECIAL_FUNCTION = 0x04;
const CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR         = 0x22;


export function Name() { return "Corsair M65 RGB Elite"; }
export function VendorId() { return 0x1b1c; }
export function ProductId() { return 0x1b5A; }
export function Publisher() { return "WhirlwindFX"; }
export function Size() { return [3, 3]; }
export function DefaultPosition(){ return [240, 120]; }
export function DefaultScale(){ return 8.0; }
export function ControllableParameters(){
	return [
		{"property":"shutdownColor", "label":"Shutdown Color", "min":"0", "max":"360", "type":"color", "default":"009bde"},
		{"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas", "Forced"], "default":"Canvas"},
		{"property":"forcedColor", "label":"Forced Color", "min":"0", "max":"360", "type":"color", "default":"009bde"},
		{"property":"DpiControl", "label":"Enable Dpi Control", "type":"boolean", "default":"false"},
		{"property":"dpi1", "label":"DPI", "step":"50", "type":"number", "min":"200", "max":"12400", "default":"800"},
	];
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

let vLedNames = ["Scroll Zone", "Dpi Zone", "Logo Zone"];

let vLedPositions = [[1, 0], [1, 1], [1, 2]];
let savedDpi1;

export function LedNames() {
	return vLedNames;
}

export function LedPositions() {
	return vLedPositions;
}

function EnableSoftwareControl() {
	let packet = [];

	// Lighting ctrl packet.
	packet[0x00]           = 0x00;
	packet[0x01]           = CORSAIR_COMMAND_WRITE;
	packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
	packet[0x03]           = CORSAIR_LIGHTING_CONTROL_SOFTWARE;

	// Send.
	device.write(packet, 65);
}


function ReturnToHardwareControl() {
	let packet = [];

	// Lighting ctrl packet.
	packet[0x00]           = 0x00;
	packet[0x01]           = CORSAIR_COMMAND_WRITE;
	packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
	packet[0x03]           = CORSAIR_LIGHTING_CONTROL_HARDWARE;

	// Send packet.
	device.write(packet, 65);
}


export function Initialize() {
	EnableSoftwareControl();
	savedDpi1 = dpi1;
	setDpi(dpi1);

}

function sendColors(shutdown = false) {
	let packet = [];
	packet[0x00]   = 0x00;
	packet[0x01]   = CORSAIR_COMMAND_WRITE;
	packet[0x02]   = CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR;
	packet[0x03]   = 0x03;
	packet[0x04]   = 0x01;


	for(let zone_idx = 0; zone_idx < vLedPositions.length; zone_idx++) {
		packet[(zone_idx * 4) + 5] = 4-zone_idx;

		let iX = vLedPositions[zone_idx][0];
		let iY = vLedPositions[zone_idx][1];

		let col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iX, iY);
		}

		packet[(zone_idx * 4) + 6] = col[0];
		packet[(zone_idx * 4) + 7] = col[1];
		packet[(zone_idx * 4) + 8] = col[2];
	}

	device.write(packet, 65);
}

export function Render() {
	sendColors();

	if(savedDpi1 !== dpi1){
		savedDpi1 = dpi1;
		setDpi(dpi1);
	}
}


function setDpi(dpi) {
	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x07;
	packet[2] = 0x13;
	packet[3] = 0xD1;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = dpi%256;
	packet[7] = Math.floor(dpi/256);
	packet[8] = dpi%256;
	packet[9] = Math.floor(dpi/256);
	device.write(packet, 65);
}

export function Validate(endpoint) {
	return endpoint.interface === 1;
}

export function Shutdown() {
	ReturnToHardwareControl();
}

export function Image() {
	return "";
}
